import React from 'react';
import  {Button,FormGroup,Table} from 'react-bootstrap'; //Added
import jsPDF from 'jspdf';                              //Added
import JsBarcode from 'jsbarcode';                      //Added

var col1 = {                                                // added
  textAlign : 'right',
  fontWeight : 'bold',
  verticalAlign: 'middle',
  borderBottom:'thin double #808080'
};
var col2 = {                                                //added
  textAlign : 'left',
  borderBottom:'thin double #808080'
};

function handleClick(proyector,e) {                         //added  
  e.preventDefault();
  console.log('gen pdf was clicked.',proyector.ubiAlias);
  console.log('Ubi alias: ', proyector.ubiAlias);
  var canvas = document.createElement('CANVAS');
  var doc = new jsPDF('p','mm','a4');
  var imgHeader = 'data:image/png;base64,';
  doc.addImage(imgHeader,'PNG',5,5,200,20,null,'FAST'); //200x20mm @600pp
  
  
  doc.line(5, 30, 205, 30);
  doc.text(105, 40, 'Proyector '+proyector.ubiAlias,{align:'center'});  
  doc.line(55, 45, 155, 45);  
  JsBarcode(canvas, proyector.ubiInvent);
  var imgBCInvent = canvas.toDataURL();
  doc.addImage(imgBCInvent,105,45.5,93.66,37.5);  
  doc.setFontSize(10);
  doc.setFontType('bold');
  doc.text(105, 50, 'Ubicación de inventario ',{align:'right'});
  doc.line(55, 84, 155, 84);
  doc.text(105, 88, 'Marca ',{align:'right'});
  doc.line(55, 90, 155, 90);
  doc.text(105, 94, 'Modelo ',{align:'right'});
  doc.line(55, 96, 155, 96);
  doc.text(105, 102, 'Etiqueta ',{align:'right'});    
  JsBarcode(canvas, proyector.etiqueta);
  var imgBCEtiqueta = canvas.toDataURL();
  doc.addImage(imgBCEtiqueta,105,97,52.92,37.5);
  doc.line(55, 133, 155, 133);  
  doc.text(105, 137, 'Etiquetado ',{align:'right'});  
  doc.line(55, 139, 155, 139);
  doc.text(105, 143, 'Año de compra ',{align:'right'});
  doc.line(55, 145, 155, 145);
  doc.text(105, 149, 'Número de serie ',{align:'right'});
  doc.line(55, 151, 155, 151);
  doc.text(105, 155, 'Dirección IP ',{align:'right'});
  doc.line(55, 157, 155, 157);
  doc.text(105, 161, 'Password ',{align:'right'});
  doc.line(55, 163, 155, 163);
  doc.text(105, 167, 'Operable ',{align:'right'});
  doc.line(55, 169, 155, 169);
  doc.text(105, 173, 'Observaciones ',{align:'right'});  
  doc.setFontType('normal');
   
  doc.text(105, 88, proyector.marca,{align:'left'});
  doc.text(105, 94, proyector.modelo,{align:'left'});
  //doc.text(105, 98, proyector.etiqueta.toString(),{align:'left'}); // ojito
  doc.text(105, 137, proyector.etiquetado,{align:'left'});
  doc.text(105, 143, proyector.año.toString(),{align:'left'});       // con los números
  doc.text(105, 149, proyector.sn,{align:'left'});
  doc.text(105, 155, proyector.ip,{align:'left'});
  doc.text(105, 161, proyector.password,{align:'left'});
  doc.text(105, 167, proyector.operable,{align:'left'});
  doc.text(105, 173, proyector.observaciones,{align:'left'}); 
  doc.save(proyector.ubiAlias+".pdf");
}


export default class Proyector extends React.Component {
  componentDidMount(){
    this.props.mappedfetchProyectorById(this.props.params.id);
  }

  render(){
    const proyectorState = this.props.mappedProyectorState;
    //console.log("id : ",this.props.params.id);
    if (!proyectorState.isFetching) {
      //console.log("ubi alias : ", proyectorState.ubiAlias);
    }
    
    return(
      
      
      <div>
      
      <h2>Detalles del Proyector</h2>
         {!proyectorState.proyector && proyectorState.isFetching &&
           <div>
             <p>Cargando proyector....</p>
           </div>
         }
       {proyectorState.proyector && !proyectorState.isFetching &&
        <div>                 
          <Table>
            <tbody>
              <tr><td style={col1}>Ubicación de inventario </td><td style={col2}><h3>{proyectorState.proyector.ubiAlias}</h3></td></tr>
              <tr><td style={col1}>Ubicación de inventario &nbsp; </td><td style={col2}>{proyectorState.proyector.ubiInvent}</td></tr>
              <tr><td style={col1}>Marca &nbsp; </td><td style={col2}>{proyectorState.proyector.marca}</td></tr>
              <tr><td style={col1}>Modelo &nbsp; </td><td style={col2}>{proyectorState.proyector.modelo}</td></tr>
              <tr><td style={col1}>Etiqueta &nbsp; </td><td style={col2}>{proyectorState.proyector.etiqueta}</td></tr>
              <tr><td style={col1}>Etiquetado &nbsp; </td><td style={col2}>{proyectorState.proyector.etiquetado}</td></tr>
              <tr><td style={col1}>Año &nbsp; </td><td style={col2}>{proyectorState.proyector.año}</td></tr>
              <tr><td style={col1}>Número de serie &nbsp; </td><td style={col2}>{proyectorState.proyector.sn}</td></tr>
              <tr><td style={col1}>IP &nbsp; </td><td style={col2}>{proyectorState.proyector.ip}</td></tr>
              <tr><td style={col1}>Password &nbsp; </td><td style={col2}>{proyectorState.proyector.password}</td></tr>
              <tr><td style={col1}>Operable &nbsp; </td><td style={col2}>{proyectorState.proyector.operable}</td></tr>
              <tr><td style={col1}>Observaciones &nbsp; </td><td style={col2}>{proyectorState.proyector.observaciones}</td></tr>              
            </tbody>
          </Table>
          <form>
            <FormGroup>
              <Button type="submit" bsStyle="danger" bsSize="small" block onClick={(e)=>handleClick(proyectorState.proyector,e)}>Generar PDF</Button>
              
            </FormGroup>
          </form>          
        </div>
        
       }
      </div>
    
    );
  }
}
